    false,nt"url": null,nt"notes": "The LiDAR data acquisition was executed
    in five sessions, on March 15, 16 & 17, 2006, using a Leica ALS50 LiDAR System.
    Specific details about the ALS50 system are included in Section 4 of this report.
    The three airborne GPS (ABGPS) base stations supporting the LiDAR acquisition were
    located on 1) a NGS SAC monumented control point inside Bush Field Airport (AGS),
    point AA2799, 2) a point inside the county u201cRS_0001u201d and 3) a another point
    nearby u201cRS_0002u201d. Dual Frequency data was logged continuously for the duration
    of each LiDAR flight mission at a one-second sampling rate. A table of control points
    for the LiDAR survey is included in Section 5 of this report. The flight plan for
    LiDAR consisted of parallel flights in a north-east/south-west extent across the
    site (see Figure B, LiDAR Flight Layout). Sixty-three (63) flight lines of LiDAR
    data were acquired in 5 sessions along with 1 cross flight across the County.",nt"owner_org":
